export default {
  // 此处编写的就是 Vue组件实例的 配置项，通过一定语法，可以直接混入到组件内部
  // data methods computed 生命周期函数
  // 注意点：
  // 1.如果此处 和组件内，提供了同名的 data 或 methods，则组件内优先级更高。
  // 2.如果编写了生命周期函数，则mixins中的生命周期函数 和 页面的生命周期函数，会用数组管理统一执行
  created () {
    console.log('嘎嘎')
  },
  data () {
    return {
      title: '标题'
    }
  },
  methods: {
    sayHi () {
      console.log('(*´▽｀)')
    }
  }
}
